import ItemList from "../components/ItemList";
import "./BuyPage.css";
import { Link } from 'react-router-dom';

const BuyPage = () => {
  return (
    <div className="buy-page">
      <h1>Marketplace</h1>
      <ItemList></ItemList>
      <Link to="/" className="home-button">Home</Link>
    </div>
  );
};

export default BuyPage;
